inefficient_solution:
class Solution:
    def permute(self, nums: List[int]) -> List[List[int]]:
        def dfs(i, nums_copy, ans):
            if i == len(nums_copy):
                ans.append(nums_copy[:])
                return
            for j in range(len(nums_copy)):
                for k in range(len(nums_copy)):
                    if j != k:
                        nums_copy[j], nums_copy[k] = nums_copy[k], nums_copy[j]
                        dfs(i + 1, nums_copy, ans)
                        nums_copy[j], nums_copy[k] = nums_copy[k], nums_copy[j]
            return ans

        ans = []
        for i in range(len(nums)):
            for j in range(len(nums)):
                if i != j:
                    for k in range(len(nums)):
                        if i != k and j != k:
                            for m in range(len(nums)):
                                if i != m and j != m and k != m:
                                    for n in range(len(nums)):
                                        if i != n and j != n and k != n and m != n:
                                            nums_copy = nums[:]
                                            nums_copy[i], nums_copy[j], nums_copy[k], nums_copy[m], nums_copy[n] = nums_copy[n], nums_copy[m], nums_copy[k], nums_copy[j], nums_copy[i]
                                            dfs(0, nums_copy, ans)

        return ans
